import { useDispatch } from "react-redux";
import './styles.css';
import protein from '../../images/protein.png';
import granola from '../../images/granola.png';
import products from '../../items/products'
// import { addToCart } from "../../slices/basketSlice";

function Popular() {
  console.log(products)
  // const dispatch = useDispatch()

  // const addItem = () => {
  //   const product = {

  //   }
  // }

  return (
    <div className ="popular__container">
      <div className="items__wrapper">
        <div className="items--contents">
          {products.map((products) => {
            <div className="products--container">
              <div className = "image--wrapper">
                <img className="protein--image" src={products.image}></img>
              </div>
              <div className = "description">
                <h1 className="tagline"> FOR YOUR WORKOUTS </h1>
                <h2 className="price"> $80 Large </h2>
                <p className="product-desc">Premium whey packed with 21g of protein per serving, for the everyday protein you need from a quality source — with all-natural nutritionals, it's ideal for all of your fitness goals.</p>
                <a href='/' className="learnMore">Learn More</a>
                <div className = "buttons">
                  <button type = "submit" className="buy">Buy</button>
                  <button type = "submit" className="subscribe">Suscribe $75/month</button>
                </div>
              </div>
            </div>
          })}

          <div className="products--container">
            <div className = "description">
              <h1 className="tagline"> FOR YOUR WORKOUTS </h1>
              <h2 className="price"> $80 Large </h2>
              <p className="product-desc">Great for breakfast or as a post-workout snack, Protein Granola is full to the brim with soy and milk protein, which helps to grow and maintain important muscle.1 Whatever your fitness ambitions, it’s a tasty protein boost whenever you need it most.</p>
              <a href='/' className="learnMore">Learn More</a>
              <div className = "buttons">
                <button type="submit" className="buy">Buy</button>
                <button type = "submit" className="subscribe">Suscribe $75/month</button>
              </div>
            </div>
            <div className = "image--wrapper">
              <img className="protein--image" src={granola}></img>
            </div>
          </div>
        </div>
      </div>
    </div>
  )
}

export default Popular
